import React from 'react';
import './footer.css';

const Footer = () => {
  return (
      <div className='footer-full'>
  <div className='container'>
      <div className='footer-content'>
          <div className='footer_logo'>
              <div>
                  <img src={process.env.PUBLIC_URL + 'images/logo.png'}></img>                  
                </div>
          </div>
          <div className='about_link'>
              <div>About Us</div>
              <p>We at DeepValley are a modern Energy provider community that provides all type of energy solution.</p>
          </div>
          <div className='connect_link'>
              <div>Contact Us</div>
              <p>Chandi Road, Near Bahadurpur, Harnaut, Nalanda, India 803110</p>
              <ul>
                      {/* <li><img src={process.env.PUBLIC_URL + 'images/facebook-logo-white.png'}></img></li>
                      <li><img src={process.env.PUBLIC_URL + 'images/insta_white.png'}></img></li> */}
                      <li className='linking'><a target="_blank" href='https://wa.me/message/I5ROZBKTKTDZJ1'><img src={process.env.PUBLIC_URL + 'images/whatsapp.png'}></img></a></li>
                  </ul>
          </div>
      </div>
  </div>
  </div>
  );
};

export default Footer;
